import React, { useContext } from "react";
import LoggedLayout from "../_loggedInLayout";
import GreenHighlight from "@/components/GreenHighlight";
import { useFetch } from "@/hooks/useFetch";
import { UserContext } from "@/contexts/UserContext";
import { Post } from "@/interfaces/interfaces";
import Jobs from "@/components/Jobs/jobs";
import { formatDate, getValueOf, milissecondsToHour } from "@/utils/utils";
import Button from "@/components/Buttons";
import jsPDF from "jspdf";
import logo from "@/assets/logo.png";

function Certificates() {
  const userCtx = useContext(UserContext);
  const certificates = useFetch<Post[]>(
    "GET",
    `posts/assistant/finished/${userCtx?.user?.Assistant?.AssistantId}`
  );

  async function savePdf(post: Post) {
    const document = new jsPDF({ orientation: "landscape" });
    const logo = new Image();
    const base64 =
      "data:image/png;base64,";

    document.addImage(base64, "PNG", 10, 10, 40, 40);
    document.setFontSize(30);
    document.setFont("helvetica", "bold");
    document.text("HandyVolunteers", 110, 35);
    document.setFont("helvetica", "normal");
    document.setFontSize(18);
    const split = document.splitTextToSize(
      `Certificamos que ${post.Assistant?.Name.toUpperCase()} realizou um trabalho voluntário para a ONG ${
        post.Ong?.OngName
      }, com a carga horária de ${milissecondsToHour(
        getValueOf(post.StartDate),
        getValueOf(post.FinishDate)
      )} horas, de ${formatDate(post.StartDate, "DD/MM/YYYY")} a ${formatDate(
        post.FinishDate,
        "DD/MM/YYYY"
      )}.`,
      280
    );
    document.text(split, 10, 80);
    const signature =
      "data:image/png;base64,";

    document.addImage(signature, "PNG", 180, 130, 90, 25);
    document.save(
      `Certificado ${Buffer.from(post.PostId)
        .toString("base64")
        .substring(0, 10)}`
    );
  }

  return (
    <LoggedLayout>
      <div className="mx-4 lg:mx-12 my-8">
        <GreenHighlight className="text-3xl font-normal">
          Meus Certificados
        </GreenHighlight>
        <p className="py-4">
          <GreenHighlight className="text-xl font-light">
            {certificates.data?.length} certificados
          </GreenHighlight>
        </p>
        <div className="certificates">
          {certificates.data?.map((certificate) => (
            <div className="py-4">
              <Certificate generatePdf={savePdf} post={certificate} />
            </div>
          ))}
        </div>
      </div>
    </LoggedLayout>
  );
}

interface CertificateProps {
  post: Post;
  generatePdf?: (post: Post) => void;
}

function Certificate({ post, generatePdf }: CertificateProps) {
  const hours = milissecondsToHour(
    getValueOf(post.StartDate),
    getValueOf(post.FinishDate)
  );

  return (
    <div className="certificate">
      <GreenHighlight className="text-lg lg:text-xl">
        Certificado{" "}
        {Buffer.from(post.PostId).toString("base64").substring(0, 10)}{" "}
      </GreenHighlight>
      <p>
        De {formatDate(post.AssignedAt, "DD/MM/YYYY")} até{" "}
        {formatDate(post.FinishedAt, "DD/MM/YYYY")}
      </p>{" "}
      <p></p>
      <p>
        Estimativa inicial: {hours} hora{hours > 1 && "s"}
      </p>
      <p>Ong: {post.Ong?.OngName}</p>
      <div className="btn py-4">
        <Button onClick={() => generatePdf && generatePdf(post)}>
          Gerar PDF
        </Button>
      </div>
    </div>
  );
}

export default Certificates;
